// EventSelector.js
import React from 'react';
import './EventSelector.css'; // Create a CSS file for styling if needed

// Placeholder imports - replace these with actual image paths
import dancingIcon from './img/dancingIcon.png';
import singingIcon from './img/singingIcon.png';
import sportsIcon from './img/sportsIcon.png';
import otherIcon from './img/otherIcon.png';

import EventButton from './EventButton'; // You will need to create this component

function EventSelector() {
  return (
    <div className="event-selector">
      <EventButton eventName="Dancing" iconImage={dancingIcon} />
      <EventButton eventName="Singing" iconImage={singingIcon} />
      <EventButton eventName="Sports" iconImage={sportsIcon} />
      <EventButton eventName="Other" iconImage={otherIcon} />
      {/* ...other EventButton components */}
    </div>
  );
}

export default EventSelector;
